import React from 'react';
// import logo from '../images/logo.svg'; how to import photos; code: src={logo}
import './Home';
import '../App';
//import { render } from "react-dom";
import { Link, Router } from "react-router-dom"

class PageSelector extends React.Component {
  // Passing down the changePage function so we can activate it when a click on a span happens
  render() {
    return (
      <div className="column">
        <Link to="/">
          <span className={this.props.emphasis} onClick={(e) => this.props.changePage(this.props.text, e)}>
            {this.props.text}
          </span>
        </Link>
      </div>
    );
  }
}

//
class Navbar extends React.Component {
  render() {
    return (
      <div className='smallHeader'>
        <div></div>
        <div></div>
        <div></div>
      </div>
    );
  }
}

class Projects extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      'clicked': false
    }
  }  // boilerplate cod

  render() {
    // Added a link here
    return (
      <div>
        <Navbar changePage={this.changePage} headerOrder={this.props.headerOrder}/>
        <h1>Projects baby!</h1>
        <p>{this.props.projects.length}</p>
        <p>{this.props.id}</p>
        <p>{this.props.selected}</p>
      </div>
    );
  }
}

export default Projects;
